from exercises.a_reverse_string import reverse_string

def test_reverse_string_0():
	assert reverse_string('str') == 'rts'

def test_reverse_string_1():
	assert reverse_string('strWithNumber0') == '0rebmuNhtiWrts'

def test_reverse_string_2():
	assert reverse_string('a') == 'a'

def test_reverse_string_3():
	assert reverse_string(LONG_STRING) == LONG_STRING_REVERSED

LONG_STRING = ''

LONG_STRING_REVERSED = ''
